// src/pages/News.js
import React from 'react';
import Post from '../components/Post/Post'; // Импортируйте компонент Post
import searchPosts from '../components/Input/search';

const SearchResultsPage = ({ filteredPosts }) => (
    <div>
          {/* Вывод отфильтрованных постов */}
      {filteredPosts.map((post) => (
        <Post key={post.id} post={post} />
      ))}
    </div>
  );
  
  export default SearchResultsPage;
